import './App.css';

import React, { Component } from 'react'
import Select from 'react-select'
import opts from './options.json'

const options = opts.json().options

const MyComponent = () => (
  <Select options={options} />
)


function App() {
  return (
    <div>
      <header>
        <p>
          Edit and save to reload.
        </p>

        <MyComponent></MyComponent>
      </header>
    </div>
  );
}

export default App;
